import React from 'react';
import './Logo.scss';

const Logo = () => (
    <div className='logo'>
        <div className='logo__top'>SJ</div>
        <div className='logo__bottom'>
            <span className="logo__bottom-text green">FOOD</span>
            <span className="logo__bottom-text white">DELIVERY</span>
        </div>
    </div>
);

export default Logo;
